trailingComments.value:
*
 * 定制导航栏
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example
 * const data = {
 *   background: {
 *     action: 'scroll',
 *     mode: 'alpha',
 *     webTopHeight: '232',
 *     imageData: '',
 *   },
 *   rightItem: [{
 *     native: false,
 *     icon: '',
 *     text: '分享',
 *     callBack: 'shareSkin',
 *     inMore: false,
 *   }],
 * };
 * libSQ.exec('action-bar-show', { params: data }).then((info) => {
 *   alert(`[action-bar-show][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[action-bar-show][error] ${JSON.stringify(err, null, 2)}`);
 * });

